import React from "react";

const Blog=(state)=>{
    const{items}= this.state.items;


const AddItem = items.map(item=>{

return(


<div>
items.push(item)
this.setState({
    items
})

<div>{item.name}</div>

</div>


)
})

return(
    <div>
<form onSubmit={AddItem}>
    <input type="text" placeholder="Add Course"/>
    <button type="submit">Add Course</button>
</form>
    </div>
)
}
export default Blog;
